import React from 'react';

function ProjectLink() {
  return (
    <div className = "project-link_home">
    	<img class = "project_pic" src="https://live.staticflickr.com/65535/49696081927_f6d02f2d83_o.png" alt="usertesting"/>
      	<div className="project_txt">
        	<a href = "lile"><h2>Lil' Einstein Website Project</h2></a>
        	<p> A UX project to redesign a toy website</p>
      	</div>
    </div>
  );
}

export default ProjectLink;
